import axios from 'axios';

export default axios.create({
    //base url for the youtube:https://www.googlepapis.com/youtube/v3
    baseURL:'https://www.googlepapis.com/youtube/v3',
    params: {
        part:'snippet', //It means it is going to return our video
        maxResolts: 5,
        key: '[API key]' 
    }
})
